  `PageNumber` int(11) NOT NULL COMMENT '回复所在页数',
  PRIMARY KEY (`ReplyId`) USING BTREE,
  INDEX `CommentId`(`CommentId`) USING BTREE,
  INDEX `UserId`(`UserId`) USING BTREE,
  CONSTRAINT `reply_ibfk_1` FOREIGN KEY (`CommentId`) REFERENCES `comment` (`CommentId`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `reply_ibfk_2` FOREIGN KEY (`UserId`) REFERENCES `account` (`UserID`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin ROW_FORMAT = Compact;

