INSERT INTO `post` VALUES ('3e943f8c8a284f7890d106d2c2393076', 1, NULL, '27e26ca20ba04b358bac0d90dd8eee8a', '03fad9dd951f4fdfbe38b967ad6ad64c', ' 近期，我们发现在游戏过程中有个别玩家为取得游戏胜利、谋取不当利益，不惜触犯国家法律法规，使用不法分子恶意开发的“炸房”程序，恶意攻击游戏服务器。该行为在造成对局玩家游戏掉线或游戏顿卡的同时，也会对服务器中其他正常体验游戏的玩家造成十分恶劣的影响。针对这一违规现象，我们已经加强了对服务器的保护，建立了监控系统密切监测，能够在第一时间发现并锁定恶意攻击行为。“炸房”等通过非正常手段扰乱游戏秩序的行为已经严重触犯了国家法律法规，对于此类不仅违背《守望先锋》竞技精神，同时更严重违反国家法律法规的行为，我们决不姑息，由此，在工作人员细致严谨的核查后，我们将根据违规情节严重程度对涉事玩家账号进行相应冻结处罚，同时我们也依然保留进一步追加处罚及依法处理此类情节严重、性质恶劣的违法行为的权利。我们一直致力于为广大玩家营造一个公平、公正的游戏环境。然而，我们仍发现不少玩家对于使用非正常手段牟利抱有侥幸心理。我们非常重视此类问题，并且将不断地优化和更新监控机制与数据核查标准。我们会持续不断地对所有破坏游戏公平性的违规行为进行严厉打击。在此，我们也呼吁每位玩家都能自觉遵守《暴雪®战网最终用户许可协议》，合理游戏。如您获知任何上述违规程序的制作、销售或散播的信息和线索，请随时发送邮件至cn_hacks@battlenet.com.cn邮箱进行举报！感谢大家对《守望先锋》的热爱和支持！', 0, ' 近期，我们发现在游戏过程中有个别玩家为取得游戏胜利、谋取不当利益，不惜触犯国家法律法规，使用不法分子恶意开发的“炸房”程序，恶意攻击游戏服务器。该行为在造成对局玩家游戏掉线或游戏顿卡的同时，也会对服务器中其他正常体验游戏的玩家造成十分恶劣的影响。针对这一违规现象，我们已经加强了对服务器的保护，建立了监控系统密切监测，能够在第一时间发现并锁定恶意攻击行为。“炸房”等通过非正常手段扰乱游戏秩序的行为已经严重触犯了国家法律法规，对于此类不仅违背《守望先锋》竞技精神，同时更严重违反国家法律法规的行为，我们决不姑息，由此，在工作人员细致严谨的核查后，我们将根据违规情节严重程度对涉事玩家账号进行相应冻结处罚，同时我们也依然保留进一步追加处罚及依法处理此类情节严重、性质恶劣的违法行为的权利。我们一直致力于为广大玩家营造一个公平、公正的游戏环境。然而，我们仍发现不少玩家对于使用非正常手段牟利抱有侥幸心理。我们非常重视此类问题，并且将不断地优化和更新监控机制与数据核查标准。我们会持续不断地对所有破坏游戏公平性的违规行为进行严厉打击。在此，我们也呼吁每位玩家都能自觉遵守《暴雪®战网最终用户许可协议》，合理游戏。如您获知任何上述违规程序的制作、销售或散播的信息和线索，请随时发送邮件至cn_hacks@battlenet.com.cn邮箱进行举报！感谢大家对《守望先锋》的热爱和支持！', 1, '2020-04-21 14:20:00', '2020-04-21 14:20:00');
INSERT INTO `post` VALUES ('420d74190df14c43adf0142599b1ae39', 1, NULL, '8f60c648dba5416f85ed0a2999e9b7f7', '03fad9dd951f4fdfbe38b967ad6ad64c', '这就是守望先锋现在的状态吗', 0, ' 这就是守望先锋现在的状态吗，技术好就是挂吗，我开小号上分怎么了，打不了骂我炸鱼就完事了，一个举报就永封，可以呀封号就封号98而已无所谓，我就佩服那客服申诉一点用都没有，我开什么了？加速器是挂？还是什么，换大号打了一段时间又给我整这一出，技术不好就说我是挂？什么人啊都，一个举报我就封号凭什么呀，这就是网易代理？这就是守望先锋？技术好一点我都错？五百强挂车不去封来搞我们平民玩家？我吐了。只能说玩守望先锋这么久是不是挂有眼睛就看得出来，自己技术不好就好好练，守望先锋再不改善真的玩不下去了。。。', 2, '2020-04-25 22:52:00', '2020-04-25 22:52:00');
