INSERT INTO `post` VALUES ('67dafc08c7324778a3b439311dfd5619', 1, NULL, '2088032295602999', '03fad9dd951f4fdfbe38b967ad6ad64c', 'fffffffffffffffffffffffffffffffffffffffff...', 51, '<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">[环球网报道&nbsp;记者&nbsp;崔妍 丁洁芸]近日，韩国自生植物园立起一座&ldquo;安倍下跪谢罪&rdquo;雕像引发争议。据日媒报道，这座雕像以日本首相安倍晋三为原型，描绘了安倍在慰安妇像前下跪的姿态。报道称，植物园原计划于8月11日为该雕像举行揭幕仪式。但由于韩国保守党不断对此提出批评，该仪式目前已中止。</p>\n<div class=\"img_wrapper\" style=\"margin: 0px; padding: 0px; text-align: center; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; font-size: 18px; letter-spacing: 1px; background-color: #ffffff;\"><img id=\"0\" style=\"margin: 0px auto; padding: 0px; border: 0px none; vertical-align: top; display: block; max-width: 640px;\" src=\"https://n.sinaimg.cn/spider2020728/711/w435h276/20200728/4557-iwxpesx5539255.png\" alt=\"\" /></div>\n<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">　　据日本TBS电视台28日报道，韩国自生植物园本月25日宣布，该园在江原道五台山脚下建造的一座&ldquo;安倍谢罪像&rdquo;将于8月10日向公众开放。雕像显示，一名身高一米八左右的男性正低着头，双手触地，虔诚下跪。一名象征着慰安妇问题的&ldquo;少女像&rdquo;则坐在他的前方。</p>\n<div class=\"img_wrapper\" style=\"margin: 0px; padding: 0px; text-align: center; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; font-size: 18px; letter-spacing: 1px; background-color: #ffffff;\"><img id=\"1\" style=\"margin: 0px auto; padding: 0px; border: 0px none; vertical-align: top; display: block; max-width: 640px;\" src=\"https://n.sinaimg.cn/spider2020728/27/w554h273/20200728/88aa-iwxpesx5539256.png\" alt=\"\" /></div>\n<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">　　报道表示，这座下跪的男性雕像以安倍晋三为原型，被命名为&ldquo;永远的赎罪&rdquo;，别名是&ldquo;安倍谢罪像&rdquo;。</p>\n<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">　　据报道，植物园原定在8月11日为该雕像举行揭幕仪式，但由于此事在被韩国媒体报道后，不断受到国内保守党的批评，所以植物园决定暂时中止仪式。&nbsp;&nbsp;</p>\n<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">　　自生植物园园长在接受TBS采访时表示：&ldquo;（立雕像）不存在政治意图。我们只是想给一个可以进行反思的机会。&rdquo;</p>\n<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">　　另据日媒&ldquo;nifty&rdquo;报道，该雕像的制作者王庆贤（音）则回应称：&ldquo;作品表达了这些曾身为慰安妇的奶奶们理所应当地接受道歉的样子，我想通过这一点来提振民族精神。我希望日本可以衷心的道歉，重生为崭新的日本，我是基于这一点创作的。&rdquo;</p>\n<div class=\"img_wrapper\" style=\"margin: 0px; padding: 0px; text-align: center; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; font-size: 18px; letter-spacing: 1px; background-color: #ffffff;\"><img id=\"2\" style=\"margin: 0px auto; padding: 0px; border: 0px none; vertical-align: top; display: block; max-width: 640px;\" src=\"https://n.sinaimg.cn/spider2020728/38/w554h284/20200728/f8fb-iwxpesx5539422.png\" alt=\"\" /></div>\n<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">　　此外，王庆贤还解释说：&ldquo;我看到国内外的慰安妇雕像时常会被外界批评或者遭到损坏，我认为有必要切实将需要赎罪的对象实体化，而不是单纯地表达立场。&rdquo;</p>\n<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">　　此事被报道后也引发日韩两国网友的讨论。很多日本网友对此表示愤怒。</p>\n<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">　　有日本网友称这是&ldquo;对一国领导人的侮辱行为&rdquo;、应立即对韩国&ldquo;发起制裁&rdquo;。&darr;</p>\n<div class=\"img_wrapper\" style=\"margin: 0px; padding: 0px; text-align: center; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; font-size: 18px; letter-spacing: 1px; background-color: #ffffff;\"><img id=\"3\" style=\"margin: 0px auto; padding: 0px; border: 0px none; vertical-align: top; display: block; max-width: 640px;\" src=\"https://n.sinaimg.cn/spider2020728/693/w554h139/20200728/ed14-iwxpesx5539420.png\" alt=\"\" /></div>\n<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">　　&ldquo;应该在8月之前发动一项制裁。这是对一国首相的侮辱行为，我们为什么必须反省呢？应该反省的是你们的总统，这是显而易见的。这不是身为国民应该做的事情。这是超越仇恨的挑衅。&rdquo;</p>\n<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">　　有网友说这是&ldquo;外交上的大问题&rdquo;，日方应该对设立这座雕像的人采取处罚。&darr;</p>\n<div class=\"img_wrapper\" style=\"margin: 0px; padding: 0px; text-align: center; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; font-size: 18px; letter-spacing: 1px; background-color: #ffffff;\"><img id=\"4\" style=\"margin: 0px auto; padding: 0px; border: 0px none; vertical-align: top; display: block; max-width: 640px;\" src=\"https://n.sinaimg.cn/spider2020728/671/w554h117/20200728/aa90-iwxpesx5539528.png\" alt=\"\" /></div>\n<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">　　&ldquo;这&hellip;&hellip;真称得上是外交上的大问题了，应该立刻召见大使，迅速撤除雕像并处罚设置雕像的人。如果韩国不能给出撤除雕像的期限，应该立即对韩国实施制裁。&rdquo;</p>\n<div class=\"img_wrapper\" style=\"margin: 0px; padding: 0px; text-align: center; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; font-size: 18px; letter-spacing: 1px; background-color: #ffffff;\"><img id=\"5\" style=\"margin: 0px auto; padding: 0px; border: 0px none; vertical-align: top; display: block; max-width: 640px;\" src=\"https://n.sinaimg.cn/spider2020728/440/w374h66/20200728/e473-iwxpesx5539525.png\" alt=\"\" /></div>\n<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">　　&ldquo;能不能因为名誉损失等原因进行起诉？&rdquo;</p>\n<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">　　还有留言称日本人已经受到太多来自韩国的侮辱。&darr;</p>\n<div class=\"img_wrapper\" style=\"margin: 0px; padding: 0px; text-align: center; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; font-size: 18px; letter-spacing: 1px; background-color: #ffffff;\"><img id=\"6\" style=\"margin: 0px auto; padding: 0px; border: 0px none; vertical-align: top; display: block; max-width: 640px;\" src=\"https://n.sinaimg.cn/spider2020728/694/w554h140/20200728/c3d4-iwxpesx5539654.png\" alt=\"\" /></div>\n<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">　　&ldquo;植物园的回应也是愚蠢的借口！那么多人都可以做雕像的原型，为什么偏偏&hellip;&hellip;。日本国民承受的侮辱是不是已经太多了？ 我觉得这已经不是撤除雕像就可以原谅的事了。&rdquo;</p>\n<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">　　另据&ldquo;nifty&rdquo;报道，一些韩国网友则对此褒贬不一。部分网友称赞了这座雕像，称其为&ldquo;杰作的诞生&rdquo;、&ldquo;很好的创意&rdquo;。甚至有韩网友认为该雕像&ldquo;应该设置日本驻韩大使馆前，而不是植物园内&rdquo;。</p>\n<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">　　但另一些网友则表示反对。有网友认为此举&ldquo;会给日韩关系带来负面影响&rdquo;，还有网友批评称，设雕像的行为 &ldquo;很幼稚&rdquo;、&ldquo;好像在嘲讽真正的受害者&rdquo;&darr;</p>\n<div class=\"img_wrapper\" style=\"margin: 0px; padding: 0px; text-align: center; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; font-size: 18px; letter-spacing: 1px; background-color: #ffffff;\"><img id=\"7\" style=\"margin: 0px auto; padding: 0px; border: 0px none; vertical-align: top; display: block; max-width: 640px;\" src=\"https://n.sinaimg.cn/spider2020728/456/w257h199/20200728/c357-iwxpesx5539653.png\" alt=\"\" /></div>\n<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">　　&ldquo;&lsquo;在少女像前下跪的安倍雕像&rsquo;，不知道什么团体干的，真的很幼稚，水准太低。&rdquo;</p>\n<div class=\"img_wrapper\" style=\"margin: 0px; padding: 0px; text-align: center; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; font-size: 18px; letter-spacing: 1px; background-color: #ffffff;\"><img id=\"8\" style=\"margin: 0px auto; padding: 0px; border: 0px none; vertical-align: top; display: block; max-width: 640px;\" src=\"https://n.sinaimg.cn/spider2020728/645/w554h91/20200728/6ffb-iwxpesx5539867.png\" alt=\"\" /></div>\n<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">　　&ldquo;弄个安倍谢罪的雕像有啥用&hellip;好像在嘲讽真正的受害者&rdquo;</p>\n<div class=\"img_wrapper\" style=\"margin: 0px; padding: 0px; text-align: center; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; font-size: 18px; letter-spacing: 1px; background-color: #ffffff;\"><img id=\"9\" style=\"margin: 0px auto; padding: 0px; border: 0px none; vertical-align: top; display: block; max-width: 640px;\" src=\"https://n.sinaimg.cn/spider2020728/679/w554h125/20200728/2f81-iwxpesx5540358.png\" alt=\"\" /></div>\n<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">　　&ldquo;弄个安倍下跪雕像干嘛呢？那样会对（慰安妇）老奶奶们有什么帮助吗？</p>\n<div class=\"img_wrapper\" style=\"margin: 0px; padding: 0px; text-align: center; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; font-size: 18px; letter-spacing: 1px; background-color: #ffffff;\"><img id=\"10\" style=\"margin: 0px auto; padding: 0px; border: 0px none; vertical-align: top; display: block; max-width: 640px;\" src=\"https://n.sinaimg.cn/spider2020728/650/w554h96/20200728/0a1e-iwxpesx5540433.png\" alt=\"\" /></div>\n<p style=\"margin: 0px 0px 18px; padding: 0px; font-size: 18px; color: #4d4f53; font-family: \'Hiragino Sans GB\', \'Microsoft Yahei\', \'\\微软雅黑\', SimSun, \'\\宋体\', Arial; letter-spacing: 1px; background-color: #ffffff;\">　　&ldquo;说实话，这有什么用呢？难道不是应该接受日本政府的道歉，而非雕像的道歉？这么做除了自我安慰还有什么用。再说了，安倍也是一国首相，应该给予相应的尊重。&rdquo;</p>\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\">\n<tbody>\n<tr>\n<td style=\"width: 8.30009%;\">&nbsp;</td>\n<td style=\"width: 8.30009%;\">&nbsp;</td>\n<td style=\"width: 8.30009%;\">&nbsp;</td>\n<td style=\"width: 8.30009%;\">&nbsp;</td>\n<td style=\"width: 8.30009%;\">&nbsp;</td>\n<td style=\"width: 8.4183%;\">&nbsp;</td>\n<td style=\"width: 8.4183%;\">&nbsp;</td>\n<td style=\"width: 8.4183%;\">&nbsp;</td>\n<td style=\"width: 8.4183%;\">&nbsp;</td>\n<td style=\"width: 8.4183%;\">&nbsp;</td>\n</tr>\n<tr>\n<td style=\"width: 8.30009%;\">&nbsp;</td>\n<td style=\"width: 8.30009%;\">&nbsp;</td>\n<td style=\"width: 8.30009%;\">&nbsp;</td>\n<td style=\"width: 8.30009%;\">&nbsp;</td>\n<td style=\"width: 8.30009%;\">&nbsp;</td>\n<td style=\"width: 8.4183%;\">&nbsp;</td>\n<td style=\"width: 8.4183%;\">&nbsp;</td>\n<td style=\"width: 8.4183%;\">&nbsp;</td>\n<td style=\"width: 8.4183%;\">&nbsp;</td>\n<td style=\"width: 8.4183%;\">&nbsp;</td>\n</tr>\n<tr>\n<td style=\"width: 8.30009%;\">&nbsp;</td>\n<td style=\"width: 8.30009%;\">&nbsp;</td>\n<td style=\"width: 8.30009%;\">&nbsp;</td>\n<td style=\"width: 8.30009%;\">&nbsp;</td>\n<td style=\"width: 8.30009%;\">&nbsp;</td>\n<td style=\"width: 8.4183%;\">&nbsp;</td>\n<td style=\"width: 8.4183%;\">&nbsp;</td>\n<td style=\"width: 8.4183%;\">&nbsp;</td>\n<td style=\"width: 8.4183%;\">&nbsp;</td>\n<td style=\"width: 8.4183%;\">&nbsp;</td>\n</tr>\n<tr>\n<td style=\"width: 8.30009%;\">&nbsp;</td>\n<td style=\"width: 8.30009%;\">&nbsp;</td>\n<td style=\"width: 8.30009%;\">&nbsp;</td>\n<td style=\"width: 8.30009%;\">&nbsp;</td>\n<td style=\"width: 8.30009%;\">&nbsp;</td>\n<td style=\"width: 8.4183%;\">&nbsp;</td>\n<td style=\"width: 8.4183%;\">&nbsp;</td>\n<td style=\"width: 8.4183%;\">&nbsp;</td>\n<td style=\"width: 8.