INSERT INTO `post` VALUES ('eaf13a219717465f84e997a6113f8206', 1, NULL, 'c31f27df98ab4ea9af9aa40dd55bb4d9', '03fad9dd951f4fdfbe38b967ad6ad64c', ' 在马上截止于4月26日的200联赛代币活动中，就剩几分钟了，被耍的团团转的我。刚开活动便参加了，网页提醒参加成功，一步步参加活动，告诉我参加成功，一次次等待告诉我需要时间，一次次和微博私信（活动联系方式微博私聊），了无音讯！很好，把玩家当空气，在截止于26日的活动，现在还剩下几分钟，最后时间我发出了最后的私信，也算是告别信，要告别我喜爱多年的守望先锋，（我不玩不会影响游戏，也不想引战，更不想被骂玩玩不玩GUN）只是因为心中对这款游戏的喜爱，让我有些不舍，仿佛一个好友的离去，渐渐地身边所有的朋友都放弃了这款游戏，只有我一个人坚持到现在，或许我已经老了，坚持不下去了，不像以前会为了一个金而高兴，会为上了最佳而喜悦，也会在斗音看看熟练，看看里外等等。但是我的大脑在今天告诉我，你是个被骗的傻子，别当傻子，特别是被骗的傻子！参加了这次活动的我仿佛一个傻子，一个可悲的白嫖档，一个生活中累，游戏中也要被骗的傻子。如果不想给，完全可以不发表活动，给人希望，然后再将希望压碎，这对现实中都艰难的人太残忍了，这次活动仿佛在说：不止现实中，游戏中你也无所谓。这不是守望先锋的错，只是结果造就了一切。也仿佛是守望先锋对我最后的警钟，不要沉迷游戏了，也许是守望先锋对我最后的温柔。守望先锋就像朋友在与我告别，没有愤怒，没有争吵，只有淡淡的伤感，也许明天会更好，也许最美的守望先锋还是留存在心底。回想着游戏里的每个角色，仿佛已经是我的好友，回想着电影一般的CG动画，也是最好的记忆。再见了守望先锋~这条路虽然崎岖难走，但我希望有缘再见~这个世界需要更多的英雄！加油！守望先锋！最后单独的告别送给我的新朋友：回声~拜拜！', 0, ' 在马上截止于4月26日的200联赛代币活动中，就剩几分钟了，被耍的团团转的我。刚开活动便参加了，网页提醒参加成功，一步步参加活动，告诉我参加成功，一次次等待告诉我需要时间，一次次和微博私信（活动联系方式微博私聊），了无音讯！很好，把玩家当空气，在截止于26日的活动，现在还剩下几分钟，最后时间我发出了最后的私信，也算是告别信，要告别我喜爱多年的守望先锋，（我不玩不会影响游戏，也不想引战，更不想被骂玩玩不玩GUN）只是因为心中对这款游戏的喜爱，让我有些不舍，仿佛一个好友的离去，渐渐地身边所有的朋友都放弃了这款游戏，只有我一个人坚持到现在，或许我已经老了，坚持不下去了，不像以前会为了一个金而高兴，会为上了最佳而喜悦，也会在斗音看看熟练，看看里外等等。但是我的大脑在今天告诉我，你是个被骗的傻子，别当傻子，特别是被骗的傻子！参加了这次活动的我仿佛一个傻子，一个可悲的白嫖档，一个生活中累，游戏中也要被骗的傻子。如果不想给，完全可以不发表活动，给人希望，然后再将希望压碎，这对现实中都艰难的人太残忍了，这次活动仿佛在说：不止现实中，游戏中你也无所谓。这不是守望先锋的错，只是结果造就了一切。也仿佛是守望先锋对我最后的警钟，不要沉迷游戏了，也许是守望先锋对我最后的温柔。守望先锋就像朋友在与我告别，没有愤怒，没有争吵，只有淡淡的伤感，也许明天会更好，也许最美的守望先锋还是留存在心底。回想着游戏里的每个角色，仿佛已经是我的好友，回想着电影一般的CG动画，也是最好的记忆。再见了守望先锋~这条路虽然崎岖难走，但我希望有缘再见~这个世界需要更多的英雄！加油！守望先锋！最后单独的告别送给我的新朋友：回声~拜拜！', 1, '2020-04-25 23:59:00', '2020-04-25 23:59:00');
INSERT INTO `post` VALUES ('ed5d9a67c13b4221b8535a58329708dd', 1, NULL, 'd78d3f2dc951429c947dc684b5a80fdb', '03fad9dd951f4fdfbe38b967ad6ad64c', ' 这OW的匹配就是肉奶C，不管你在哪个分段，也不管你打什么模式，也基本不可能给你6强C，4强C玩一年你也排不上几次。快速里每局必有奶T玩起C位的，这也是你为何在快速里杀起人来好爽，以前好多主玩天使的，会在快速玩百合，那真得是靶子一样。这大概也是为何OW后来会强制222，因为他本来是想让你们自觉的。自从强制222后好了一些，但也导致了，快速也基本是打222。新出这个自由排位也基本是打222，因为就是这么匹配的，6C他又玩不动，没意思。在这种机制下，你就必须跟肉奶保持配合，利用他们的资源，你再强一个人突进也是打不出效果的想要全员浪嗨，在现有的这种玩法，胜出，匹配机制下，没有可能这样的现状就导致了，有些只能拿肉奶，C位完全玩不动的也能上分；有些C位实力并不强，但擅长利用资源，也能上分；有些C位很强，但是正因为太强不喜欢受局限的打法，总想杀光，但是呢，对面是6个人，队友又不是全强力，嗨不动的，打得难受还上不了分。OW分段混乱也正是配合会导致数据失真，我半藏打排位跟着大团都不用刻意瞄准，命中都能上50%，打快速，全员狗位命中都不到20%。如果不是跟着大团，只绕后，偷，狙，虽然一局能暴杀15个以上，但仍然很容易输，因为这OW就是这么匹配的，你不带着队友，他们就只能蹭来蹭去。说实话，这种游戏方式，真TM没劲，但OW又不会按你的想法来，毕竟OWL的直播效果还是要的。还不如吃J爽一点，虽然匹配的队友也多半都是S X，但你只要不管他们，一个人打进决赛圈，一局杀10个还是可以的，也挺有趣。我觉得，C位占了总玩家数的7成，为何不能搞一个模式让C位嗨一下呢，我就想不通了，竞技游戏你不以更强为准则，搞起了平衡，是什么鬼，什么鬼哟', 0, ' 这OW的匹配就是肉奶C，不管你在哪个分段，也不管你打什么模式，也基本不可能给你6强C，4强C玩一年你也排不上几次。快速里每局必有奶T玩起C位的，这也是你为何在快速里杀起人来好爽，以前好多主玩天使的，会在快速玩百合，那真得是靶子一样。这大概也是为何OW后来会强制222，因为他本来是想让你们自觉的。自从强制222后好了一些，但也导致了，快速也基本是打222。新出这个自由排位也基本是打222，因为就是这么匹配的，6C他又玩不动，没意思。在这种机制下，你就必须跟肉奶保持配合，利用他们的资源，你再强一个人突进也是打不出效果的想要全员浪嗨，在现有的这种玩法，胜出，匹配机制下，没有可能这样的现状就导致了，有些只能拿肉奶，C位完全玩不动的也能上分；有些C位实力并不强，但擅长利用资源，也能上分；有些C位很强，但是正因为太强不喜欢受局限的打法，总想杀光，但是呢，对面是6个人，队友又不是全强力，嗨不动的，打得难受还上不了分。OW分段混乱也正是配合会导致数据失真，我半藏打排位跟着大团都不用刻意瞄准，命中都能上50%，打快速，全员狗位命中都不到20%。如果不是跟着大团，只绕后，偷，狙，虽然一局能暴杀15个以上，但仍然很容易输，因为这OW就是这么匹配的，你不带着队友，他们就只能蹭来蹭去。说实话，这种游戏方式，真TM没劲，但OW又不会按你的想法来，毕竟OWL的直播效果还是要的。还不如吃J爽一点，虽然匹配的队友也多半都是S X，但你只要不管他们，一个人打进决赛圈，一局杀10个还是可以的，也挺有趣。我觉得，C位占了总玩家数的7成，为何不能搞一个模式让C位嗨一下呢，我就想不通了，竞技游戏你不以更强为准则，搞起了平衡，是什么鬼，什么鬼哟', 1, '2020-04-26 13:58:00', '2020-04-26 13:58:00');
